import React from "react";
import { DashSidebar } from "../../styledComponents/Dashboard/dashboardSidebar";

const DashboardSideBar = () => {
  return (
    <DashSidebar>
      <div className="sidebar">
        <ul className="sidebar-container">
          <label>&#2715</label>
          <li>
            <a href="/"></a>
          </li>
          <li>
            <a href="/">Profile</a>
          </li>
          <li>
            <a href="/">Graphs</a>
          </li>
          <li>
            <a href="/">settings</a>
          </li>
          <li>
            <a href="/">Log out</a>
          </li>
        </ul>
      </div>
    </DashSidebar>
  );
};

export default DashboardSideBar;
